const RecipeForm = () => {
  return (
    <div className="box">
      <h1>Add Your Recipe</h1>
      <div className="form-container">
        <div className="input-group">
          <labe>
            Nama Resep : <input type="text" />
          </labe>
        </div>
      </div>
    </div>
  );
};

export default RecipeForm;
